export default function DashboardScreen(){
    return (
            <Grid>
                <DashboardHeader size={1} />
                <Row size={2}>
                    <Text>
                        ABC
                    </Text>

                    <FloatingAddButton/>
                </Row>
            </Grid>
    );
}



const DashboardText = styled.Text`
    fontSize: ${moderateScale(22,0.4)};
